// Route Views

import HomePage from "./views/HomePage";
import FormExample from "./views/FormExample";
import LoginForm from "./views/LoginForm";
import SignupForm from "./views/SignupForm";

export default [
    {
        path: "/",
        exact: true,
        component: HomePage
    },
    {
        path: "/login",
        exact: true,
        component: LoginForm 
    },
    {
        path: "/signup",
        exact: true,
        component: SignupForm
    },
    {
        path: "/example",
        exact: true,
        component: FormExample
    },
    /*{
        path: "",
        exact: false,
        component: NotFound
    }*/
];
